import React, { Component } from "react";
import { Avatar } from "@material-ui/core";

class MyAccount extends Component {
  render() {
    return (
      <div style={{ minHeight: 600 }}>
        <span
          style={{
            fontSize: 25,
            fontWeight: "bold",
            marginTop: 20,
            color: "grey"
          }}
        >
          User name
        </span>

      </div>
    );
  }
}

export default MyAccount;
